-- ----------------------------
DROP TABLE IF EXISTS `aos_sys_module`;
CREATE TABLE `aos_sys_module` (
  `id_` varchar(64) NOT NULL COMMENT '',
  `cascade_id_` varchar(255) NOT NULL COMMENT 'ID',
  `name_` varchar(255) NOT NULL COMMENT '',
