  `icon_name_` varchar(255) DEFAULT NULL COMMENT '',
  `status_` varchar(255) NOT NULL DEFAULT '1' COMMENT '',
  `parent_name_` varchar(255) NOT NULL COMMENT '',
  `vector_` varchar(255) DEFAULT NULL COMMENT '',
  `sort_no_` int(10) DEFAULT '0' COMMENT '',
  PRIMARY KEY (`id_`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='';

