out realtempout int,
inout realnum int )
BEGIN

DECLARE Done INT DEFAULT 0;
      
       DECLARE rs_num INT;
      
       DECLARE realcasid VARCHAR(100);
       /*  */
       DECLARE rs CURSOR FOR SELECT cascade_id_ FROM ss_checkjob_checkitem;
       /*  */
	/*DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET Done = 1;*/

	DECLARE  CONTINUE HANDLER FOR NOT FOUND  SET  Done = 1; /*when "not found" occur,just continue,,NOT FOUND*/
	SET rs_num = 0;
   
    /*  */	
    OPEN rs;  
   
    /* LingQi */
    FETCH NEXT FROM rs INTO realcasid;     
    /*  */
    REPEAT
          IF NOT Done THEN
